import React, {useState, useEffect} from 'react'

function App() {

  const [data, setData] = useState([{}]);

  useEffect(() =>{
    fetch("/members").then(
      res => res.json()
    .then(
      data =>{
        setData(data);
        console.log(data);
      }
    ))
  },[])

  return (
    <div >
      <span>My new app</span>
    </div>
  );
}

export default App;
